INSERT INTO `v1_90f5a76eda8df2745cea5e8cb9c236dc9714e000a35ac2deaa201504350320dc` VALUES (10, "むっ、ちょっと待て。\nこの絵のテーマは、繰り返される\n運命の闘争が織りなす限りなき\nウロボロスの循環ではないのか！？", 1, 0.5, 18812031, 100911, 0, 11, 0, 1, 18812);
