INSERT INTO `v1_90f5a76eda8df2745cea5e8cb9c236dc9714e000a35ac2deaa201504350320dc` VALUES (10, "またまた～！　そんなのアレですよ、\nそう言われてうちらがワーワー騒いでる\nところに、後ろからカリンねえさんが\nプラカード持って出てくるやつですよ。", 1, 0.5, 37912026, 110911, 0, 11, 0, 1, 37912);
